import React from "react"

export default function Hero(props){
    return(
        <div className="hero-container">
            <img src={`../public{props.item.img}`} className="hero-img" />
            <div >
                <h2 className="hero-title">
                    {props.title}
                </h2>
            </div>
            <div className="hero-about">
            <h2>
                about: {props.about}
            </h2>
            </div>
        </div>
    )
}
